import React from 'react';
import logo from './Yorkshire-Water-logo.jpg';
import './App.css';
import {Button} from 'react-bootstrap';
import 'bootstrap/dist/css/bootstrap.min.css';

function App() {
  return (
    <div>
      <header>
        <img src={logo} class="logo" alt="logo" width="400" height="200"/>
      </header>
        <div>
        <style type="text/css">
          {`.btn-xxl {
            padding: 2rem 3rem;
            font-size: 2rem;
          }
          `}
        </style>

        <Button variant="outline-primary" size="xxl" class="central">
          Data Input
        </Button>

        <Button variant="outline-primary" size="xxl" class="central">
          Run Model
        </Button>

        <Button variant="outline-primary" size="xxl" class="central">
          Get Results
        </Button>

          <div> 
          <style type="text/css">
            {`.btn-xxl {
              padding: 2rem 3rem;
              font-size: 2rem;
            }
            `}
          </style>
          <Button variant="outline-primary" size="xxl" class="lower">
          Update Sheets
          </Button>
          </div>

        </div>

      </div>
  );
}

export default App;
